import React from 'react';
import Typist from 'react-typist';
import './landing.scss';

export default class Landing extends React.Component {
    render () {
        return (
            <section className="landing-page">
                <Typist className="landing-page__introduction">
                    <span className="landing-page__introduction--partA">Hello! I am your music therapist</span>
                    <Typist.Backspace count={14} delay={200} />
                    <span className='landing-page__introduction--partB'>upy!</span>
                </Typist>
            </section>
        )
    }
}
